    return <>
        <h1> <TermBlink>Membrii SRSI</TermBlink> </h1><br/>
        <PersonalCard 
            avatar="https://scontent-otp1-1.xx.fbcdn.net/v/t1.0-9/60230974_2482027885149154_8763349780681195520_o.jpg?_nc_cat=106&ccb=2&_nc_sid=174925&_nc_ohc=7cAcJ8QB_0oAX-OL5sC&_nc_ht=scontent-otp1-1.xx&oh=d9fa39a335b4e3aaeb6bd05336243af2&oe=5FF1359D"
            name="Serban Cercelescu"
        />
    </>;
}

export default Membri;
